import React from "react";
import "./header.css";

const Header = () => {
  return (
    <div className="header">
      {/* Left Section: Logo */}
      <div className="logo">CoinCraft</div>

      {/* Center Section: Navigation */}
      <div className="nav">
        <a href="/project-listing">Project Listing</a>
        <a href="/find-project">Find a Project</a>
        <a href="/be-a-verifier">Be a Verifier</a>
      </div>

      {/* Right Section: Connect Wallet */}
      <div className="wallet-button">
        <button>Connect Wallet</button>
      </div>
    </div>
  );
};

export default Header;
